USE mysql;

DROP DATABASE IF EXISTS running_gag_database;
CREATE DATABASE running_gag_database;
USE running_gag_database
CREATE USER 'running_gag'@'localhost';
GRANT ALL PRIVILEGES ON running_gag_database.* TO 'running_gag'@'localhost';
FLUSH PRIVILEGES;

CREATE TABLE Customer(
	ID UUID primary key NOT NULL,
	firstName varchar(50) NOT NULL,
	lastName varchar(50) NOT NULL
	);

CREATE TABLE Reading(
    ID UUID primary key NOT NULL,
    customerId UUID NOT NULL,
    dateOfReading date NOT NULL,
    typeOfReading varchar(50) NOT NULL,
    meterCount int NOT NULL,
    comment varchar(50) NOT NULL DEFAULT '',
    FOREIGN KEY (customerId) REFERENCES Customer(ID)
);


